import React, { Component } from 'react';
import './Get.css';
import HomeHeader from '../Header/HomeHeader'
import Footer from '../Footer/Footer'
import axios from 'axios'
class HomePage extends Component {
constructor() {
super();
this.state = {
    students: [
        { name: 'Ram', age: 21, place: 'Panvel' , gender: 'Male' },
        { name: 'Ravaan', age: 22, place: 'Vashi' , gender: 'Male' },
        { name: 'Anand', age: 29, place: 'Vadala' , gender: 'Male' },

     ]
};


}

onPost = () => {
    this.props.history.push('/Post')
  }

  getData = () => {
      alert("loading")
      axios.get('http://localhost:8000/route/posts', {
        method: 'GET',
        headers: {
            'Accept': 'application/json',
            'content-type': 'application/json',
        },
    })
        .then((responseJson) => {
            console.log("This is my response Json", responseJson.data)
            console.log("Get Data------>>>", responseJson.data.posts[0])
            //  var token = responseJson.data.token;
            // var message = responseJson.message;
            // var userId = responseJson.data.userId;
            var data = [];

            var message = responseJson.data.message;
            alert(message)
            if (message === "Fetched sucessfull") {
                this.props.history.push('/Home')
            }
            // if (message === 'User Not Found !' || message === ' Email or Password wrong!' || message === 'Register Please!') {
            //          } else  {
            //         (message === 'undefined')
            //          console.log("Homepage");
            //          console.log('token'+token);
            //        //  this.props.navigation.navigate('HomePage',{token: token,user:user});
            //     }

        })
        .catch((error) => {
            console.error(error);
        });
}

renderTableHeader() {
    let header = Object.keys(this.state.students[0])
    return header.map((key, index) => {
       return <th key={index}>{key.toUpperCase()}</th>
    })
 }

 renderTableData() {
    return this.state.students.map((student, index) => {
       const { name, age, place, gender } = student //destructuring
       return (
          <tr>
             <td>{name}</td>
             <td>{age}</td>
             <td>{place}</td>
             <td>{gender}</td>
          </tr>
       )
    })
 }

render() {

// NOTE: I use data-attributes for easier E2E testing
// but you don't need to target those (any css-selector will work)
return (
  <div >
  <HomeHeader clickhome={() => this.onPostHome()} 
  click={() => this.onPost()} />
         <div>
            <h1 id='title' onClick={this.getData}>Get Data</h1>
            <table id='students'>
               <tbody>
                  <tr>{this.renderTableHeader()}</tr>
                  {this.renderTableData()}
               </tbody>
            </table>
         </div>
<Footer/>
</div>
);
}
}
export default HomePage;
